import React from 'react';
import { FiSearch } from 'react-icons/fi'

import './Header.css';

const Header = () => (
  <header className="header">
    <a href='#'>
      <FiSearch />
      <input type="text" placeholder='Search collections' />
    </a>
  </header>
);

export default Header;
